import React,{useState} from 'react';
export default function App() {
  const [task, setTask] = useState(['big']);
  function hanldeOnSubmit(event) {
    setTask()
    alert(task);
  }


  return (
    <div style={{textAlign:'center'}}>
      <h2>WEB APP TO DO</h2>
      <div>
        <form onSubmit={hanldeOnSubmit}>
          Add Task :
           <input type='text' name='task' onChange={event => hanldeOnSubmit(event)} />
           <input type='submit' value='Submit' />
        </form>
      </div>
    </div>
  );
}
